std::complex<double> DT::A1A1wWTree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return -0.125*((MHSqcomp - MS1Sqcomp)*s*token14*token16*token2*token25*token65*token78*(s*(s - 4.*token283) + 12.* (MW*MW*MW*MW)))/((MHSqcomp - s)*(-MS1Sqcomp + s)* (MW*MW*MW*MW));
}

// Conjugate of the tree-level amplitude without polarization sum factors
std::complex<double> DT::A1A1wWTreeConj(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return std::conj(-0.5*((MHSqcomp - MS1Sqcomp)*s*token14*token16*token2*token25*token65*token78)/((MHSqcomp - s)*(-MS1Sqcomp + s)));
}

